export const TEXTURE_KEYS = Object.keys(TEXTURES) as unknown as (keyof typeof TEXTURES)[];

export const textureData = async () =>
	Object.fromEntries(
		await Promise.all(
			Object.entries(TEXTURES).map(async ([k, v]) => {
				return [
					k,
					{
						...v,
						original: URL.createObjectURL(
							await fetch(new URL(await v['original'], import.meta.url)).then((r) => r.blob())
						)
					}
				] as const;
			})
		)
	) as Record<Texture, Omit<(typeof TEXTURES)[keyof typeof TEXTURES], 'original'> & {original: Awaited<Promise<string>>}>;

